void screenViewBase::buttonCallbackHandler(const touchgfx::AbstractButton& src)
{
    if (&src == &MonitorButton)
    {
        //ClickMonitorButton
        //When MonitorButton clicked call virtual function
        //Call ClickMonitorButton
        ClickMonitorButton();
    }
    else if (&src == &SettingButton)
    {
        //ClickSettingButton
        //When SettingButton clicked change screen to SettingScreen
        //Go to SettingScreen with no screen transition
        application().gotoSettingScreenScreenNoTransition();
    }
    else if (&src == &PEEP_button)
    {
        //ClickPEEP
        //When PEEP_button clicked call virtual function
        //Call ClickPEEP
        ClickPEEP();
    }
    else if (&src == &PControl_button)
    {
        //ClickPControl
        //When PControl_button clicked call virtual function
        //Call ClickPControl
        ClickPControl();
    }
    else if (&src == &RR_button)
    {
        //ClickRR
        //When RR_button clicked call virtual function
        //Call ClickRR
        ClickRR();
    }
    else if (&src == &VT_button)
    {
        //ClickVT
        //When VT_button clicked call virtual function
        //Call ClickVT
        ClickVT();
    }
    else if (&src == &IE_button)
    {
        //ClickIEButton
        //When IE_button clicked call virtual function
        //Call ClickIEButton
        ClickIEButton();
    }
    else if (&src == &FiO2_button)
    {
        //ClickFiO2
        //When FiO2_button clicked call virtual function
        //Call ClickFiO2
        ClickFiO2();
    }
    else if (&src == &Ti_button)
    {
        //ClickTi
        //When Ti_button clicked call virtual function
        //Call ClickTi
        ClickTi();
    }
    else if (&src == &flow_button)
    {
        //ClickFlow
        //When flow_button clicked call virtual function
        //Call ClickFlow
        ClickFlow();
    }
    else if (&src == &trigger_button)
    {
        //ClickTrigger
        //When trigger_button clicked call virtual function
        //Call ClickTrigger
        ClickTrigger();
    }
    else if (&src == &sensivity_button)
    {
        //ClickSensitivity
        //When sensivity_button clicked call virtual function
        //Call ClickSensitivity
        ClickSensitivity();
    }
    else if (&src == &CPAP_button)
    {
        //ClickCPAP
        //When CPAP_button clicked call virtual function
        //Call ClickCPAP
        ClickCPAP();
    }
    else if (&src == &PS_button)
    {
        //ClickPS
        //When PS_button clicked call virtual function
        //Call ClickPS
        ClickPS();
    }
    else if (&src == &riseTime_button)
    {
        //ClickRiseTime
        //When riseTime_button clicked call virtual function
        //Call ClickRiseTime
        ClickRiseTime();
    }
    else if (&src == &confirm_button)
    {
        //click_confirm
        //When confirm_button clicked call virtual function
        //Call click_confirm
        click_confirm();
    }
    else if (&src == &startButton)
    {
        //ClickStartVent
        //When startButton clicked call virtual function
        //Call ClickStartVent
        ClickStartVent();
    }
    else if (&src == &pauseButton)
    {
        //ClickStopVent
        //When pauseButton clicked call virtual function
        //Call ClickStopVent
        ClickStopVent();
    }
    else if (&src == &cancelButton)
    {
        //click_cancelAlert
        //When cancelButton clicked call virtual function
        //Call click_cancelAlert
        click_cancelAlert();
    }
    else if (&src == &yesButton)
    {
        //click_yesAlert
        //When yesButton clicked call virtual function
        //Call click_yesAlert
        click_yesAlert();
    }
}
